import React from "react";
import { useFetch } from "../../../hooks/useFetch";
import { ListGroup } from "react-bootstrap";

export const Cart = () => {
  const { data, loading, error } = useFetch("http://localhost:5000/myTickets");

  return (
    <div>
      <ListGroup>
        {data?.map((e) => (
          <ListGroup.Item key={e._id}>
            <div className="d-flex justify-content-between">
              <div className="d-flex column">
                <h4>Block {e.ticket.Block}</h4>
                <h4>Reihe {e.ticket.line}</h4>
                <h4>Sitzplatz {e.ticket.seat}</h4>
              </div>
            </div>
          </ListGroup.Item>
        ))}
      </ListGroup>
    </div>
  );
};
